@-moz-document domain("twitter.com") {
/* SUSHI -sushi- for chrome extension */
/*
thanks to @3qgt
https://github.com/syaro/like2sushi-for-chrome-extension
*/

/* Sushi animation */
.HeartAnimation, .Icon--heart {
    background: url(data:image/png;base64,) !important;
    background-size: 2900% !important;
    background-position: left !important;
	
    animation-timing-function: steps(28) !important;
    animation-duration: .8s !important;
    height: 50px !important;
    width: 50px !important;
    left: -100% !important;
    top: -100% !important;
}

.WebToast-action--heart {
    position: relative !important;
    height: 38px;
}

.Icon--heart {
    color: transparent !important;
    height: 100%;
    width: 70px;
    position: absolute !important;
    top: 0;
    left: 0;
    line-height: 38px;
}

.Icon--heart:hover, .WebToast.favorited .Icon--heart {
    background-position: right !important;
}

.HeartAnimationContainer {
    overflow: visible !important;
}

.ProfileTweet-action--favorite .ProfileTweet-actionButton:hover .HeartAnimation, .ProfileTweet-action--favorite .ProfileTweet-actionButton:focus .HeartAnimation, .favorited .ProfileTweet-action--favorite .HeartAnimation {
    background-position: right !important;
}

/* Hide original tooltip */
.tooltip {
    visibility: hidden !important;
}

/* "いいね" - "すし" substitution */
[data-original-title="いいね"] .HeartAnimation:before, [data-original-title="お気に入りに登録"] .HeartAnimation:before {
    content: "すし";
    width: 40px;
    left: -6px;
}

[data-original-title="「いいね」を取り消す"] .HeartAnimation:before, [data-original-title="お気に入り削除"] .HeartAnimation:before {
    content: "「すし」を取り消す";
    width: 140px;
    left: -55px;
}

/* Tooltip Pseudo-element */
.HeartAnimation:before {
    transition: opacity .3s ease;
    max-width: 200px;
    white-space: normal;
    overflow: hidden;
    text-overflow: ellipsis;
    padding: 10px;
    border-radius: 4px;
    color: #fff;
    text-align: center;
    text-decoration: none;
    background-color: #292f33;
    position: absolute;
    z-index: 5002;
    display: block;
    visibility: visible;
    font-size: 12px;
    opacity: 0;
    -ms-filter: "alpha(opacity=0)";
    -webkit-transform: translateZ(0px);
    transform: translateZ(0px);
    top: -26px;
    pointer-events: none;
}

.HeartAnimation:hover:before, .HeartAnimation:hover:after {
    transition: opacity .1s ease;
    opacity: .95;
    -ms-filter: "alpha(opacity=95)";
}

.HeartAnimation:after {
    content: "";
    opacity: 0;
    position: absolute;
    width: 0;
    height: 0;
    top: 5px;
    left: 50%;
    margin-left: -5px;
    border-left: 5px solid transparent;
    border-right: 5px solid transparent;
    border-top: 5px solid #292f33;
    transition: opacity .3s ease;
}

/* Navigation bar Sushi substitution */
[data-nav="favorites"] .ProfileNav-label {
    visibility: hidden;
    position: relative;
}

[data-nav="favorites"] .ProfileNav-label:before {
    visibility: visible;
    content: "すし";
    position: absolute;
    width: 40px;
}

/* Sushi notification icon */
.Icon--heartBadge:before {
    content: "" !important;
    background-image: url(data:image/png;base64,) !important;
    display: block !important;
    width: 16px !important;
    height: 16px !important;
    padding: 0px !important;
}

/* Keyboard shortcut Sushi substitution */
#keyboard-shortcut-menu table:first-of-type tr:nth-of-type(2) td:nth-of-type(2) {
    visibility: hidden;
    position: relative;
}
#keyboard-shortcut-menu table:first-of-type tr:nth-of-type(2) td:nth-of-type(2):after {
    visibility: visible;
    content: "すし";
    position: absolute;
    left: 8px;
}
#keyboard-shortcut-menu table:last-of-type tr:nth-of-type(5) td:nth-of-type(2) {
    visibility: hidden;
    position: relative;
}
#keyboard-shortcut-menu table:last-of-type tr:nth-of-type(5) td:nth-of-type(2):after {
    visibility: visible;
    content: "すし";
    position: absolute;
    left: 8px;
}

/* favorited popup Sushi substitution */
[data-activity-popup-title~="いいね"] {
    visibility: hidden;
    position: relative;
}
[data-activity-popup-title~="いいね"] * {
    visibility: visible;
}
[data-activity-popup-title~="いいね"]:after {
    visibility: visible;
    content: "すし";
    position: absolute;
    top: 24px;
    left: 0;
}

.Icon--heart.u-block {
    width: 52px !important;
    height: 38px !important;
    top: 0px !important;
    left: 0px !important;
    padding: 0px !important;
}
}
